import Link from "next/link";

const LandingHeader = () => (
  <div className="landing">
    <h1 className="landing--title">Woo Young Choi</h1>
    <p>I build things for the web.</p>
    <style jsx>
      {`
        .landing {
          color: #00ace6;
          font-family: "Georgia, serif";
          margin-left: auto;
          margin-right: auto;
        }

        .landing--title {
          font-size: 20px;
          font-weight: normal;
          vertical-align: middle;
          text-decoration: none;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
